import React, { useState } from 'react';
import { fetchTrajectory } from '../services/api';

function TrajectoryPage() {
  const [author, setAuthor] = useState('');
  const [data, setData] = useState([]);
  const [suggestions, setSuggestions] = useState([]);

  const recommendedAuthors = [
    "Rachel Bawden",
    "BenoÃ®t Sagot",
    "Maged S. Al-Shaibani",
    "Yassir Fathullah",
    "Jaehoon Kim"
  ];

  const handleInputChange = (e) => {
    const keyword = e.target.value;
    setAuthor(keyword);

    if (keyword.length === 0) {
      setSuggestions([]);
      return;
    }

    const filtered = recommendedAuthors.filter(name =>
      name.toLowerCase().includes(keyword.toLowerCase())
    );
    setSuggestions(filtered);
  };

  const handleSuggestionClick = (name) => {
    setAuthor(name);
    setSuggestions([]);
    fetchTrajectory(name).then(res => {
      setData(res.data);
    }).catch(err => {
      console.error("API error:", err);
      setData([]);
    });
  };

  const handleSearch = () => {
    if (!author) return;
    fetchTrajectory(author).then(res => {
      setData(res.data);
    }).catch(err => {
      console.error("API error:", err);
      setData([]);
    });
  };

  const computeStatistics = () => {
    if (data.length === 0) return null;

    const degrees = data.map(d => d.degree ?? 0);
    const years = data.map(d => d.year);
    const totalDegree = degrees.reduce((a, b) => a + b, 0);
    const peakDegree = Math.max(...degrees);
    const peakYear = data.find(d => d.degree === peakDegree)?.year;
    const deltas = degrees.slice(1).map((d, i) => d - degrees[i]);
    const maxDelta = deltas.length > 0 ? Math.max(...deltas) : 0;

    return {
      startYear: Math.min(...years),
      endYear: Math.max(...years),
      totalDegree,
      peakDegree,
      peakYear,
      maxDelta
    };
  };

  const stats = computeStatistics();

  return (
    <div style={{ padding: '20px' }}>
      <h2>Author Trajectory</h2>

      <div style={{ marginBottom: '10px', position: 'relative' }}>
        <input
          value={author}
          onChange={handleInputChange}
          placeholder="Enter author name"
          style={{ marginRight: '10px', padding: '8px', width: '300px', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <button onClick={handleSearch} style={{ padding: '8px 20px' }}>Search</button>

        {suggestions.length > 0 && (
          <ul style={{
            position: 'absolute',
            top: '40px',
            background: '#fff',
            border: '1px solid #ddd',
            width: '300px',
            borderRadius: '5px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.15)',
            listStyle: 'none',
            margin: 0,
            padding: '5px',
            zIndex: 10
          }}>
            {suggestions.map((name, idx) => (
              <li
                key={idx}
                onClick={() => handleSuggestionClick(name)}
                style={{ padding: '5px', cursor: 'pointer' }}
              >
                {name}
              </li>
            ))}
          </ul>
        )}
      </div>

      <div style={{ marginBottom: '20px' }}>
        <h4>Recommended Authors:</h4>
        {recommendedAuthors.map(name => (
          <button
            key={name}
            onClick={() => handleSuggestionClick(name)}
            style={{ marginRight: '10px', marginBottom: '10px', padding: '5px 10px' }}
          >
            {name}
          </button>
        ))}
      </div>

      {data.length === 0 ? (
        <p>No data. Please search an author.</p>
      ) : (
        <div style={{ display: 'flex', gap: '30px' }}>
          <div style={{ flex: 1 }}>
            <h3>Trajectory Data</h3>
            <ul>
              {data.map((item, idx) => (
                <li key={idx}>
                  <strong>{item.year}</strong> - Degree: {(item.degree ?? 0).toFixed(3)}
                </li>
              ))}
            </ul>
          </div>

          <div style={{
            flex: 1,
            background: '#f9f9f9',
            border: '1px solid #ddd',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
          }}>
            <h3>Trajectory Analysis</h3>
            <p><strong>Active Period:</strong> {stats.startYear} ~ {stats.endYear}</p>
            <p><strong>Peak Degree:</strong> {stats.peakDegree} (in {stats.peakYear})</p>
            <p><strong>Total Collaborations:</strong> {stats.totalDegree.toFixed(3)}</p>
            <p><strong>Max Year-to-Year Growth:</strong> {stats.maxDelta.toFixed(3)}</p>
          </div>
        </div>
      )}
    </div>
  );
}

export default TrajectoryPage;
